'use strict';

angular.module('document').factory('DocumentService', function($rootScope, UserService) {

    var icons = [
        {
            mime: 'application/pdf',
            icon: '/images/icons/pdf_16x16.png'
        },
        {
            mime: 'application/vnd.ms-word.document',
            icon: '/images/icons/word_16x16.png'
        }
    ];

    var documents = [
        {
            id:   1001,
            name: 'Manifest',
            owner: UserService.getById(1001),
            views: 800,
            uploaded: new Date(),
            modified: new Date(),
            type: 'application/pdf',
            sharedWith: [],
            locked: false,
            base64: ''
        },
        {
            id:   1002,
            name: 'Strategy',
            owner: UserService.getById(1001),
            views: 500,
            uploaded: new Date(),
            modified: new Date(),
            type: 'application/pdf',
            sharedWith: [UserService.getById(1002)],
            locked: true,
            base64: ''
        },
        {
            id:   1003,
            name: 'Bug List',
            owner: UserService.getById(1001),
            views: 800,
            uploaded: new Date(),
            modified: new Date(),
            type: 'application/vnd.ms-word.document',
            sharedWith: [],
            locked: false,
            base64: ''
        },
        {
            id:   1004,
            name: 'Collection',
            owner: UserService.getById(1002),
            views: 250,
            uploaded: new Date(),
            modified: new Date(),
            type: 'application/zip',
            sharedWith: [],
            locked: false,
            base64: ''
        }
    ];

    var isDocument = function(document) {
        return !(_.isUndefined(document.name) || _.isUndefined(document.owner) || _.isUndefined(document.views));
    };

    return {
        count: function() {
            return documents.length;
        },
        add: function(document) {
            if(isDocument(document)) {
                documents.push(document);
                $rootScope.$broadcast('document:created', document);
                return true;
            }
            return false;
        },
        getDocumentsByOwner: function(owner) {
            return _.filter(documents, function(document) {
                return document.owner.id == owner.id
            });
        },
        countLocked: function() {
            var count = 0;

            _.each(documents, function(document) {
                if(document.locked) {
                    count++;
                }
            });

            return count;
        },
        countViews: function() {
            var count = 0;

            _.each(documents, function(document) {
                count += document.views;
            });

            return count;
        },
        getDocuments: function() {
            return documents;
        },
        getDocumentIcon : function(document) {
            var icon = _.find(icons, function (icon) {
                return document.type == icon.mime
            });

            return !_.isUndefined(icon) ? icon.icon : '/images/icons/archive_16x16.png';
        },
        getLastId: function() {
            var lastId = 0;
            _.each(documents, function(document){
                if(document.id > lastId) {
                    lastId = document.id;
                }
            });

            return lastId;
        },
        remove: function(document) {
            var index = documents.indexOf(document);
            if(index > -1) {
                documents.splice(index, 1);
                $rootScope.$broadcast('document:deleted', document);
            }
        }
    }
});
